import React from "react";
import styled from "styled-components";

const Message = styled.div`
  margin: 10em auto;
  text-align: center;
`;
const ThankYou = props => (
  <Message>
    <h1>Thank you for your gift to Free Spirits.</h1>
  </Message>
);

export default ThankYou;
